import { Injectable } from '@angular/core';

import * as pdfMake from "pdfmake/build/pdfmake";
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
const htmlToPdfmake = require("html-to-pdfmake");
(<any>pdfMake).vfs = pdfFonts.pdfMake.vfs;

import * as XLSX from 'xlsx';

@Injectable({
  providedIn: 'root'
})
export class DownloadService {

  constructor() { }

  downloadAsXLSX(data: { firstName: string, lastName: string, email: string}[]): void {
    const filename = 'file';

    // let { sheetName, fileName } = XLSX.getFileName(name);

    var wb = XLSX.utils.book_new();
    var ws = XLSX.utils.json_to_sheet(data);
    XLSX.utils.book_append_sheet(wb, ws, filename);
    XLSX.writeFile(wb, `${filename}.xlsx`);

  }

  downloadAsPDF(body: string): void {

    let html = `
      <div>
        <img style="width: 250px" src="data:image/png;base64," alt="Logo Academy Bank">
        <div style="text-align: right; width: 200px; margin-top: 20px">
            <p>Nome Cognome<br>
            xxxxxxxxxxx</p>
        </div>
        ${body}
      </div>
`   ;
    const docDefinition = {
      content: [
        htmlToPdfmake(html, {imagesByReferences: true})
      ],
    };

    pdfMake.createPdf(docDefinition).download('documento.pdf');
  }


}
